import React from 'react'

function Lab() {
    return (
        <div className="lab">
            <h1>Lab.</h1>
            <p>이 곳은 연구실입니다.</p>
            <p>연구 중인 내용을 기록하고 보관합니다.</p>
        </div>
    )
}

export default Lab;
